import React from 'react';
import {Link, Route} from 'react-router-dom';


const Home = () => {


    return (

        <section>
            
        <nav>
            <Link to="/" >Home</Link>
            <Link to="/pizza" >Pizza</Link>

        </nav>

        <Route exact path="/">

            <h1></h1>


        </Route>

        </section>


    )



}

export default Home;
